import { useState } from "react";
import Home from "./pages/Home";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import AboutUs from "./pages/AboutUs";
import Contact from "./pages/Contact";

function App() {
  const [sortType, setSortType] = useState("default");
  return (
    <div>
      <div className="table w-[900px] flex items-center">
        <a href="/" className="inline-block align-middle mr-8">
          <img src="/logo.png" alt="Quakify Logo" className="h-12" />
        </a>
        {/* Menü butonları burada devam eder */}
        {/* ...mevcut menü kodları... */}
      </div>
      <Router>
        <Routes>
          <Route exact path="/" element={<Home sortType={sortType} setSortType={setSortType} />} />
          <Route exact path="/about" element={<AboutUs />} />
          <Route exact path="/contact" element={<Contact />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
